TMSDimension checkField(TMSSequence _sequence, TMSDimension _field)
{
    return TMSCarrierService::checkField(_sequence, _field, element.LookupType(_sequence));
}

boolean fieldMandatory(TMSSequence _sequence)
{
    return TMSRateBaseTypeField::findByCodeSequenceAndFieldType(TMSRateMaster::find(TMSRateBase.RateMasterCode).RateBaseTypeCode,
                                                                _sequence,
                                                                TMSFieldType::RateBase).Mandatory;
}

boolean fieldMandatoryWithBreak(TMSSequence _sequence, int _totalLabels)
{
    boolean                 ret;
    TMSRateBaseTypeField    field;

    if (TMSRateBaseTypeField::findByCodeSequenceAndFieldType(TMSRateMaster::find(TMSRateBase.RateMasterCode).RateBaseTypeCode,
                                                                _sequence,
                                                                TMSFieldType::RateBase).Mandatory)
    {
        ret = true;
    }
    else
    {
        select firstonly Mandatory, Sequence from field
            order by field.Sequence desc
            where field.RateBaseTypeCode == TMSRateMaster::find(TMSRateBase.RateMasterCode).RateBaseTypeCode &&
                  field.FieldType        == TMSFieldType::RateBase;

        if (_sequence > field.Sequence && _sequence <= _totalLabels && field.Mandatory)
        {
            ret = true;
        }
    }

    return ret;
}

public void init()
{
    TMSRateBaseAssignment   rateBaseAssignment;

    if (element.args().dataset() == tableNum(TMSRateBaseAssignment))
    {
        rateBaseAssignment  = element.args().record();
        masterCode          = rateBaseAssignment.RateMasterCode;
    }

    super();
}

