public void init()
{
    super();

    qbrMasterCode = this.query().dataSourceTable(tablenum(TMSRateBase)).addRange(fieldnum(TMSRateBase, RateMasterCode));
    qbrMasterCode.status(RangeStatus::Hidden);
}

public void executeQuery()
{
    qbrMasterCode.value(masterCode);

    super();
}

public int active()
{
