public void write()
{
    TMSTmpRateBaseDetail        origRateBaseDetail;

    origRateBaseDetail = TMSTmpRateBaseDetail.orig();

    super();

    TMSRateBaseDetail::updateFromTmpRateBaseDetail(TMSRateBase.RateBaseCode, TMSTmpRateBaseDetail, origRateBaseDetail);
}

public void delete()
{
    TMSTmpRateBaseDetail        origRateBaseDetail;

    origRateBaseDetail = TMSTmpRateBaseDetail.orig();

    super();

    TMSTmpRateBaseDetail::deleteRateBaseDetails(TMSRateBase.RateBaseCode, origRateBaseDetail);
}

public int active()
{
    int ret;

    ret = super();

    delete_from TMSTmpRateBaseDetail;
    TMSTmpRateBaseDetail.initFromRateBaseDetails(TMSRateBaseDetail);
    TMSTmpRateBaseDetail_ds.executeQuery();

    return ret;
}

public void executeQuery()
{
    super();

    delete_from TMSTmpRateBaseDetail;
    TMSTmpRateBaseDetail.initFromRateBaseDetails(TMSRateBaseDetail);
    TMSTmpRateBaseDetail_ds.executeQuery();

    element.setBreakDetailLabels(TMSTmpRateBaseDetail.getLabels(TMSRateBase.RateBaseCode));
}

